import axios from 'axios'
import React, { Component } from 'react'
import { Table } from 'react-bootstrap'
import { Apiurl } from '../services/apirest'
import { ModalMapRouteView } from '../components/Routes/ModalMapRouteView'
import { ModalMapRouteEdit } from '../components/Routes/ModalMapRouteEdit'

export class MyRoutes extends Component {

  state = {
    data: []
  }

  username = localStorage.getItem("username");

  getRoutes = () => {
    let url = Apiurl + "/api/users/" + this.username + "/routes"
    axios.get(url)
      .then(res => {
        this.setState({ data: res.data })

      })
  }
  componentDidMount() {
    this.getRoutes();
  }

  render() {
    return (
      <div>
        <h1>My Routes</h1>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>id</th>
              <th>Line</th>
              <th>View</th>
              <th>Accion</th>
            </tr>
          </thead>
          <tbody>
            {Array.from({ length: 4 }).map(Route => (
                <tr key={Route._id}>
                  <td>{Route._id}</td>
                  <td>{Route.name}</td>
                  <td> <ModalMapRouteView id={Route._id} name={Route.name} /></td>
                  <td>
                    <ModalMapRouteEdit id={Route._id} name={Route.name} />
                    <button className="btn btn-danger">Delete</button>
                  </td>
                </tr>
              )
            )}
          </tbody>
        </Table>
      </div>
    )
  }
}
